import React, {Component} from 'react'

export default class Ingresar extends Component{
  constructor(props){
    let ingreso = false
    this.state = {
      nombre: '',
      password: '',
      ingreso
    }
  }
  render(){
    return (
      <div>
          <h1>Hola puto</h1>
      </div>
    )
  }
}
